window.bookSummaryJSON = "<p>An ongoing, episodic \"prose comic\" from which the pictures are summoned by the magic of words, <i>Goon Squad</i> is set in an alternate version of modern-day Manchester. Its biggest divergence from the real city is that it - along with most other large urban centers - has a team of superheroes to protect it against unusual threats with which the conventional forces of law and order would have problems. </p> <p><i>Goon Squad: Year One</i> offers three action-packed volumes in a single collection: </p> <p><i>Goon Squad, Vol. 1: Special Talents</i> </p> <p></p> <ul> <li>\"The New Girl\" </li> <li>\"Nightclubbing\" </li> <li>\"By the Water, by the Grave\" </li> <li>\"Changes\" </li> <li>\"No-No Dojo\" </li> <li>\"Exterminating Angel\" </li> </ul> <p></p> <p><i>Goon Squad, Vol. 2: Without Sin</i> </p> <p></p> <ul> <li>\"A Star in Strange Ways\" </li> <li>\"Holy Fool\" </li> <li>\"Dead Man Tells Tale\" </li> <li>\"A Brief History of the Goon Squad\" </li> <li>\"Tale of Terror\" </li> <li>\"Pomona Island\" </li> </ul> <p></p> <p><i>Goon Squad, Vol. 3: Old Enemies</i> </p> <p></p> <ul> <li>\"Life During Wartime\" </li> <li>\"Red Wolf, Red Wolf, Does Whatever a Red Wolf Can\" </li> <li>\"Shadow of the Vivisector\" </li> <li>\"The Man from Switzerland\"</li> <li>\"The End of the Year Show\" </li> </ul> <p></p>"; 
